import React from 'react';
import './App.css';

function ImageText(props) {
  let className = "banner";
  if(props.dark) {
    className = className + " dark";
  }
  return (
    <div class="banner-container">
      <img src={props.img} alt="" class={className}/>
      <div  class="centered">
        <p style={{margin: '-10px'}}>{props.first}</p>
        <h1>{props.head}</h1>
        <p>{props.last}</p>
        <p>
          <a role="button" class="btn btn-outline-primary" href="https://twitter.com/RealRainbowMike" target="_blank"><i class="fab fa-twitter"></i></a>
          <a role="button" class="btn btn-outline-primary" href="https://github.com/MichaelInAction" target="_blank"><i class="fab fa-github"></i></a>
          <a role="button" class="btn btn-outline-primary" href="https://www.linkedin.com/in/mread15/" target="_blank"><i class="fab fa-linkedin-in"></i></a>
          <a role="button" class="btn btn-primary" href="MichaelReadResume.pdf" download="MichaelReadResume" target="_blank">Resume</a>
        </p>
      </div>
    </div>
  );
}

export default ImageText;
